Ad Text:
6 + 12 + 12 month contract 
Baseline Security Clearance | EL1 
ACT - Hybrid - 3 days onsite (after 3 months on site full time) 

Our client, a very large Federal Government Organisation, whose focus is on national security, emergency management, boarder control, immigration and multicultural affairs, are seeking the experience of a Senior Business Analyst to shape strategy, analyse complex business needs and deliver smarter, streamlined processes across major ICT programs. 

Duties of the Senior Business Analyst 

Provide strategic planning, mapping and modelling development;
Lead gap-analysis activities to determine whether any of the existing capabilities held within the Department can meet the requirements for a future visualisation capability;
Identify and convey (verbally and in writing) the objective of a business need to the appropriate stakeholder level – enterprise, program, operational and project levels;
Work on highly complex projects;
Define and document new business practices and processes in a consistent and easily understood manner and facilitating the agreement and sign-off of these with appropriate stakeholders;
Work in and across teams to achieve the identified work area outcomes - this may require team leadership and/or technical leadership skills;
Organise, facilitate and co-facilitate workshops to extract business requirements and defining new or improved business processes.

 Skills and Experience Required

Strong Business Modelling with expertise in industry modelling techniques;
Proven Business Process Improvement across complex programs;
Skilled in Business Situation Analysis with ability to manage ambiguity;
Strategic Planning experience, producing insights and driving change plans;
Enterprise & Business Architecture, developing capability roadmaps and business cases;
Data Modelling & Design with ability to maintain and communicate data structures;
5+ years in a Senior Business Analyst role;
Experience in User Experience Analysis and user story development;
Requirements Definition & Management across complex programs.

